import React from "react";
import { Col, Row } from "react-bootstrap";

const ResumeItem = (props) => (
  <Row>
    <Col md={3}><h2>{props.heading}</h2></Col>
    <Col>
      <h4>{props.title}</h4>
      <h5>{props.subhead}</h5>
      <p>{props.text}<br/>
      {props.text2}</p>
      <hr></hr>
    </Col>
  </Row>
);

export default ResumeItem;
